        time:"12:10",
        location:"chittoor",
        addnewappointments:function(){ },
        updateappointments:function(){ },
        deleteappointments:function(){ }

        

    })
    return (<div>
        <ul>
            {Object.keys(CalendarAppointments).map((key) => {
                return <li>{CalendarAppointments[key]}</li>
            })}
        </ul>
    </div>
    )
}
